import "./App.css";
import NavAll from "./nav";
import Footer from "./footer";
import Sevices from "./services";
import Guess from "./train";
import Form from "./form";
import ArrOp from "./array";
import ShapeEditor from "./shapes";
import { link, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <NavAll />

      <Guess />
      <Form />
      <ArrOp />
      <ShapeEditor />
      <link to="/services">Services</link>
      <Sevices />
      <Footer />
    </div>
  );
}

export default App;
